//Props stands of properties.Props are like function arguments in javascript and attributes in HTML

import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import Social from "./app";

const img1_="data:image/png;base64,";
const img2_=""
const img3_="data:image/png;base64,";





ReactDOM.render(<><Social imgsrc={img1_}
    title="Linkedin"
    span="This is my likedin"
    link="https://www.linkedin.com/in/mani-singh-07313b218/"
/>
<Social imgsrc={img2_}
title="Instagram"
span="This is my instagram"
link="https://instagram.com/_.mannniiii?utm_source=qr&igshid=MzNlNGNkZWQ4Mg%3D%3D"
/>
